create table repartidor (
	curp_repartidor VARCHAR(50),
	fecha_de_nacimiento DATE,
	genero VARCHAR(50),
	calle VARCHAR(50),
	estado VARCHAR(50),
	municipio VARCHAR(50),
	codigo_postal VARCHAR(50),
	numero VARCHAR(50),
	nombre VARCHAR(50),
	apellido_paterno VARCHAR(50),
	apellido_materno VARCHAR(50),
	salario VARCHAR(50),
	horario VARCHAR(50),
	calificacion VARCHAR(50),
	curp_supervisor VARCHAR(14)
);
